import React from "react";
import { Link } from "react-router-dom";
import Navbar from "./navbar";

const Home = () => {
  return (
    <div className="min-h-screen bg-black text-white flex flex-col">
      <Navbar /> {/* Include Navbar at the top */}

      <div className="flex flex-col items-center justify-center flex-grow text-center px-6">
        <h1 className="text-4xl font-bold mb-4">Welcome to the Quiz App!</h1>
        <p className="text-lg mb-6">
          Test your knowledge with our interactive quizzes. Click below to get started.
        </p>
        <Link to="/quiz">
          <button className="px-6 py-3 bg-blue-500 text-white rounded-lg text-xl hover:bg-blue-600 transition">
            Start Quiz
          </button>
        </Link>
      </div>

      <footer className="text-center py-4 bg-gray-900">
        <p>&copy; {new Date().getFullYear()} Quiz App. All Rights Reserved.</p>
      </footer>
    </div>
  );
};

export default Home;
